// import logo from './logo.svg';
// import './App.css';
import About from './About/About';
import bimage from './b.png'
import Main from './main/main';
import Navbar from './Navbar/navbar'
import Services from './Services/services';
function App() {
  return (
    <>
    <div style={{backgroundImage:`url(${bimage})`}}>
    <Navbar/>
    <br /> <br /> <br />
    <Main/>
    <br /> <br /> <br /> 
    <About/>

    </div>
    <br /><br /><br />
    <Services/>

    </>
  );
}

export default App;
